import React, { useState } from 'react';

// useState로만 해보기
function SubmitForm({ formData, setFormData, categoryOptions }) {
    // const [name, setName] = useState('');
    // const [price, setPrice] = useState(0);
    // const [category, setCategory] = useState('');
    // const [getDate, setGetDate] = useState(''); // 초기값 뭘로??
    const [isMemo, setIsMemo] = useState(false);
    // const [memoText, setMemoText] = useState('');
    // const [repurchase, setRepurchase] = useState('');
    const handleSubmit = (event) => {
        event.preventDefault();

        let newData = {
            id: new Date().getTime(),
            name: '',
            price: 0,
            category: '',
            date: '',
            memoCheck: isMemo,
            memoText: '',
            repurchase: false,
        };
        // let newData = {
        //     id: new Date().getTime(),
        //     name: name,
        //     price: price,
        //     category: category,
        //     date: getDate,
        //     memoCheck: isMemo,
        //     memoText: memoText,
        //     repurchase: repurchase === "Yes" ? true : false,
        // };

        setFormData([...formData, newData]);
    };

  return (
    <div className="submit-form">
        <form id="form" onSubmit={handleSubmit}>
            <div>
                <label className="label" htmlFor="name">이름</label>
                <input type="text" id="name" onChange={(event) => setFormData({...newData, name:event.target.value})}/>
            </div>
            <div>
                <label className="label" htmlFor="price">가격</label>
                <input type="number" id="price" onChange={(event) => setFormData({...newData, price:event.target.value})}/>
            </div>
            <div>
                <label className="label" htmlFor="category">유형</label>
                <select id="category" onChange={(event) => setFormData({...newData, category:event.target.value})}>
                    <option value="">선택하세요</option>
                    {
                        categoryOptions.map((option) => (
                            <option value={`${option}`}>{option}</option>
                        ))
                    }
                </select>
            </div>
            <div>
                <label className="label" htmlFor="date">구입 날짜</label>
                <input type="date" id="date" onChange={(event) => setFormData({...newData, getDate:event.target.value})}/>
            </div>
            <div>
                <label className="label" htmlFor="memo-text">메모</label>
                <input type="checkbox" id="memo" onClick={() => setIsMemo(!isMemo)}/>
                <label htmlFor="memo">메모 작성</label>
                {/* 메모 작성 버튼을 눌렀을 때만 보이도록 */}
                {
                    isMemo && <input type="text" id="memo-text" onChange={(event) => setFormData({...newData, memoText:event.target.value})}/>
                }
            </div>
            <div>
                <label className="label">재구매 의사</label>
                <input type="radio" name="repurchase" id="yes" value={'Yes'} onClick={(event) => setFormData({...newData, repurchase:Boolean(event.target.value)})}/>
                <label htmlFor="yes">한다</label>
                <input type="radio" name="repurchase" id="no" value={''} onChange={(event) => setFormData({...newData, repurchase:Boolean(event.target.value)})}/>
                <label htmlFor="no">안한다</label>
            </div>
            <button type="submit">저장</button>
        </form>
    </div>
  )
}

export default SubmitForm
